import * as S from  "../../styles/MyPage/Advice.style";

function Advice() {
  return (
    <S.Box>
      <S.TextBox>몸 상태와 강도에 따라</S.TextBox>
      <S.TextBox>운동 또는 식단을 추가할 거에요</S.TextBox>
    </S.Box>
  );
}

export default Advice;
